import React from 'react';

function Cart() {
  // Retrieve cart data from localStorage
  const storedCart = JSON.parse(localStorage.getItem('cart'));

  return (
    <div>
      <h1>Cart Menu</h1>
      <ul>
        {storedCart && storedCart.map((item, index) => (
          <li key={index}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default Cart;
